import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Blog from './Components/Blog'
import { makeStyles } from '@material-ui/core/styles'
import ContactMe from './Components/Blog'
import Home from '../src/MainPages/Home'
import Post from '../src/MainPages/Post'
import TopBar from './Components/TopBar/TopBar'
import Write from '../src/MainPages/Write/Write'
import SideBar from './Components/SideBar'
import EditPost from './AuthorPages/EditPost';
export const Routes = () => {
    const useStyles = makeStyles((theme) => ({
        body:{
         display:"flex",
         flexDirection:"row",
         justifyContent:"flex-end"
        }

            }))




            const classes = useStyles()

  return (


      <Switch>
          <div> 
          <TopBar/>
          <div className={classes.body} >

              <Route path="/" exact component={Home} />
              <Route path="/write" exact component={Write} />
              <Route path="/blog" exact component={Blog} />
              <Route path="/contactMe" exact component={ContactMe} />
              <Route path="/post/:id" exact component={Post} />
              <Route path="/editPost/:id" exact component={EditPost} />
              <SideBar className={classes.sideBar}/>
          </div>
          </div>
      </Switch>
  )
}

export const App = () => {
  return (
      <Router>
          <Routes />
      </Router>
  )
}

export default App
